import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Carousel, Button, Container, Row, Col, Card, Form } from "react-bootstrap";
import mobileImg from "../../Assets/mobile.jpg";
import laptopImg from "../../Assets/laptop.jpeg";
import speakerImg from "../../Assets/speaker.jpeg";

function Landing() {
  const navigate = useNavigate();

  const handleBookRepair = () => {
    navigate("/jobform");
  };

  // Reusable star rating display
  const StarRating = ({ stars }) => (
    <div style={{ color: "#FFA500", fontSize: "18px" }}>
      {"★".repeat(stars)}
      {"☆".repeat(5 - stars)}
    </div>
  );

  // State for reviews
  const [reviews, setReviews] = useState([
    { name: "Sarah M.", text: "My phone screen was replaced within an hour. Excellent service and very friendly staff!", stars: 5 },
    { name: "John D.", text: "Got my laptop fixed quickly. Works like new again. Affordable prices too!", stars: 4 },
    { name: "Emily R.", text: "They fixed my speaker perfectly. Now the sound is crystal clear. Highly recommend!", stars: 5 },
  ]);

  // State for form inputs
  const [formData, setFormData] = useState({ name: "", text: "", stars: 5 });

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleStarChange = (e) => {
    setFormData({ ...formData, stars: parseInt(e.target.value) });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name || !formData.text) return;

    const newReviews = [...reviews, formData];
    if (newReviews.length > 3) newReviews.shift(); // remove oldest
    setReviews(newReviews);

    setFormData({ name: "", text: "", stars: 5 }); // reset form
  };

  return (
    <div style={{ backgroundColor: "#F8F9FA", minHeight: "100vh" }}>
      {/* Carousel Section */}
      <Container style={{ maxWidth: "900px", paddingTop: "50px" }}>
        <Carousel fade interval={3000} pause={false}>
          <Carousel.Item>
            <img className="d-block w-100 rounded" src={mobileImg} alt="Mobile Repair"
              style={{ maxHeight: "400px", objectFit: "cover" }} />
            <Carousel.Caption style={{ backgroundColor: "rgba(0,87,184,0.6)", borderRadius: "8px" }}>
              <h5 style={{ color: "#fff" }}>Mobile Repairs</h5>
              <p style={{ color: "#fff" }}>Screen, battery, charging issues fixed quickly.</p>
            </Carousel.Caption>
          </Carousel.Item>

          <Carousel.Item>
            <img className="d-block w-100 rounded" src={laptopImg} alt="Laptop Repair"
              style={{ maxHeight: "400px", objectFit: "cover" }} />
            <Carousel.Caption style={{ backgroundColor: "rgba(0,87,184,0.6)", borderRadius: "8px" }}>
              <h5 style={{ color: "#fff" }}>Laptop & Desktop Repairs</h5>
              <p style={{ color: "#fff" }}>Hardware/software troubleshooting for PCs & laptops.</p>
            </Carousel.Caption>
          </Carousel.Item>

          <Carousel.Item>
            <img className="d-block w-100 rounded" src={speakerImg} alt="Speaker Repair"
              style={{ maxHeight: "400px", objectFit: "cover" }} />
            <Carousel.Caption style={{ backgroundColor: "rgba(0,87,184,0.6)", borderRadius: "8px" }}>
              <h5 style={{ color: "#fff" }}>Speaker Repairs</h5>
              <p style={{ color: "#fff" }}>Sound issues and wiring problems fixed professionally.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>

        {/* Book Repair Button */}
        <div className="text-center mt-4">
          <Button
            onClick={handleBookRepair}
            style={{
              backgroundColor: "#FFA500",
              color: "#212529",
              fontWeight: "600",
              padding: "10px 30px",
              borderRadius: "50px",
              border: "none",
            }}
          >
            Book a Repair
          </Button>
        </div>
      </Container>

      {/* Customer Reviews Section */}
      <div style={{ backgroundColor: "#FFFFFF", padding: "60px 0" }}>
        <Container>
          <h2 className="text-center mb-5" style={{ color: "#0057B8", fontWeight: "700" }}>
            What Our Customers Say
          </h2>
          <Row className="g-4">
            {reviews.map((review, idx) => (
              <Col md={4} key={idx}>
                <Card
                  style={{
                    border: "none",
                    backgroundColor: "#F8F9FA",
                    borderRadius: "15px",
                    padding: "20px",
                    boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
                  }}
                >
                  <StarRating stars={review.stars} />
                  <p style={{ color: "#6C757D", marginTop: "15px" }}>
                    "{review.text}"
                  </p>
                  <h6 style={{ fontWeight: "700", color: "#212529" }}>- {review.name}</h6>
                </Card>
              </Col>
            ))}
          </Row>

          {/* Add Review Form */}
          <div className="mt-5">
            <h4 className="text-center mb-4" style={{ color: "#212529", fontWeight: "600" }}>
              Add Your Review
            </h4>
            <Form onSubmit={handleSubmit} style={{ maxWidth: "600px", margin: "0 auto" }}>
              <Form.Group className="mb-3">
                <Form.Label>Your Name</Form.Label>
                <Form.Control
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                  placeholder="Enter your name"
                  required
                />
              </Form.Group>

              <Form.Group className="mb-3">
                <Form.Label>Your Review</Form.Label>
                <Form.Control
                  as="textarea"
                  rows={3}
                  name="text"
                  value={formData.text}
                  onChange={handleInputChange}
                  placeholder="Write your review"
                  required
                />
              </Form.Group>

              <Form.Group className="mb-3">
                <Form.Label>Rating</Form.Label>
                <Form.Select name="stars" value={formData.stars} onChange={handleStarChange}>
                  <option value={5}>★★★★★ (5)</option>
                  <option value={4}>★★★★☆ (4)</option>
                  <option value={3}>★★★☆☆ (3)</option>
                  <option value={2}>★★☆☆☆ (2)</option>
                  <option value={1}>★☆☆☆☆ (1)</option>
                </Form.Select>
              </Form.Group>

              <div className="text-center">
                <Button type="submit" style={{ backgroundColor: "#0057B8", border: "none", padding: "10px 30px" }}>
                  Submit Review
                </Button>
              </div>
            </Form>
          </div>
        </Container>
      </div>
    </div>
  );
}

export default Landing;
